import React from "react";

function Index() {
  return (
    <>
      <div className="flex flex-col items-center justify-center w-full min-h-screen px-4 pt-20 pb-4 space-y-4 max-w-screen">
        <h1 className="text-4xl font-semibold tracking-widest text-gray-700">
          Welcome
        </h1>
        <p className="max-w-lg tracking-widest text-justify text-gray-800">
          I'm Alex Bruns. This is my website. My old one was mostly work
          focused. You can find it{" "}
          <a
            href="https://alexbruns.dev"
            target="_blank"
            className="font-semibold underline hover:text-blue-600"
          >
            here
          </a>
          . This new site is more focused on my personal work. You'll find info
          about <strong>books</strong> I'm reading, <strong>programming</strong>{" "}
          stuff I'm tinkering with, and possibly even some{" "}
          <strong>politics/philosophy</strong> (not sure about this yet).
        </p>
      </div>
      <div className="fixed top-0 left-0 right-0 flex flex-wrap items-center w-full h-16 px-4 space-x-8">
        <a>Books</a>
        <a>Programming</a>
        <a>Politics & Philosophy</a>
      </div>
    </>
  );
}

export default Index;
